import React from "react";
// import styled from "styled-components";
import { styled } from '@mui/material/styles';
import Button from '@mui/material/Button';
import CloudUploadIcon from '@mui/icons-material/CloudUpload';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';
// import {data} from "../Backend/excel.js";
// const Alldates = require("../Backend/excel");
const name1 = localStorage.getItem('uniqueDates');
const VisuallyHiddenInput = styled('input')({
    clip: 'rect(0 0 0 0)',
    clipPath: 'inset(50%)',
    height: 1,
    overflow: 'hidden',
    position: 'absolute',
    bottom: 0,
    left: 0,
    whiteSpace: 'nowrap',
    width: 1,
});

const Home = () => {
    // console.log(Alldates.Alldates);
    // console.log("Unique Dates:", data);
    console.log(name1) // John
        const [Date, setDate] = React.useState('');
    const handleChange = (event) => {
            setDate(event.target.value);
        };
        return (
            <>
        <h1> Seating Arrangment</h1 >
            <Button component="label" variant="contained" startIcon={<CloudUploadIcon />}>
                Upload Excel Sheet
                <VisuallyHiddenInput type="file" />
            </Button>
            <FormControl sx={{ m: 1, minWidth: 120 }} size="small">
                <InputLabel id="demo-select-small-label">Date</InputLabel>
                <Select
                    labelId="demo-select-small-label"
                    id="demo-select-small"
                    value={Date}
                    label="Date"
                    onChange={handleChange}
                >
                    {/* <MenuItem value="">
                        <em>None</em>
                    </MenuItem> */}
                    <MenuItem value={10}>Ten</MenuItem>
                    <MenuItem value={20}>Twenty</MenuItem>
                    <MenuItem value={30}>Thirty</MenuItem>
                </Select>
            </FormControl>
        </>
    )
};
export default Home;
